import { Link, NavLink } from "react-router-dom";

function Nav(){
    return(
        <nav>
            <NavLink to="/"></NavLink>
            <NavLink to="/services">Services</NavLink>
            <NavLink to="/work">Work</NavLink>
            <NavLink to="/about">About</NavLink>
            <NavLink to="/contact">Contact</NavLink>
        </nav>
    );
}

export default Nav;
